    "crescent-lake-national-wildlife-refuge-narrative-report-may-1-to-august-31-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1963. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, fish, reptiles, and disease- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, and wildfires. Resource
    management is outlined; topics include grazing, haying, and fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, fishing, and safety. N-R forms and photographs are attached. A short
    narrative report of North Platte National Wildlife Refuge is included.",nt"license_title":
